[Form]
public class WHSLoadPlanningListPage extends FormRun implements WHSILoadIdRangeProvider
{
    QueryBuildRange                 qbrLoad;
    WHSLoadStatus                   loadStatusFilter;
    boolean                         activeOnly;
    boolean                         showClosedLoads;
    boolean                         filteredByMenuItem;
    WHSLoadPlanningListPageForm     whsLoadPlanningListPageForm;
    protected QueryBuildDataSource  qbds;

    [SysObsolete('This class member is deprecated because it is not used in this class anymore.', false, 17\04\2024)]
    boolean                         isWhsAllLoadsFormSavedViewsFixFlightEnabled;
    boolean                         executeQueryWasRun;

}

public void init()
{

    boolean inTransitPlanning;

    whsLoadPlanningListPageForm = new WHSLoadPlanningListPageForm();

    if (element.args().parmEnumType() == enumNum(WHSLoadStatus))
    {
        filteredByMenuItem = true;
        loadStatusFilter = element.args().parmEnum();
    }

    if (element.args().menuItemName() == menuitemDisplayStr(WHSLoadPlanningListPageActive))
    {
        filteredByMenuItem = true;
        activeOnly = true;
    }

    super();

    inTransitPlanning = TMSParameters::find().InTransitPlanning;
    ButtonGroupHubConsolidation.visible(inTransitPlanning);
    OverrideLocation.visible(inTransitPlanning);
    btnPostShipTransfer.visible(whsLoadPlanningListPageForm.shouldBtnPostShipTransferBeVisible());

    if (element.args().record())
    {
        this.setShowClosed(true);
        whsLoadTable_ds.executeQuery();
    }

    showClosed.enabled(!filteredByMenuItem);
}

protected internal void queryFiltersChanged()
{
    super();

    if (!filteredByMenuItem)
    {
        this.setShowClosed(whsLoadPlanningListPageForm.queryAllowsClosedLoads(WHSLoadTable_ds.queryRun().query()));
    }
}

public void executeQuery()
{
    if (!filteredByMenuItem)
    {
        //Don't set qbrLoad for the first run of executeQuery to protect against overwriting initially loaded saved view range.
        if (executeQueryWasRun)
        {
            qbrLoad = SysQuery::findOrCreateRange(WHSLoadTable_ds.queryBuildDataSource(), fieldNum(WHSLoadTable, LoadStatus));
            qbrLoad.value(whsLoadPlanningListPageForm.calcShowClosedRangeValue(showClosedLoads));

            //It's needed, otherwise a new unwanted side effect that it hadn't happen before the modification, would appear:
            //When we started the form with any 'show closed' saved view, unchecking 'show closed' would have no effect (because it hits the range disabled by Saved Views feauture)
            qbrLoad.enabled(true);
        }
    }

    super();
    executeQueryWasRun = true;
}

private void enableTMSActions(boolean _enable)
{
    ActionPaneTabTMS.enabled(_enable);

    TransportationTender.enabled(_enable && whsLoadTable.isAssociableToTender());
    tmsInvoiceJournal.enabled(_enable && TMSFreightBillDetail::existsInvoiceJournal(whsLoadTable.RouteCode, whsLoadTable.LoadId));
    manualRoute.enabled(_enable && whsLoadTable.RouteCode == '');
    addRoute.enabled(_enable 
                     && !whsLoadTable.RouteCode 
                     && whsLoadTable.LoadDirection == WHSLoadDirection::Inbound);
}

        public int active()
        {
            int ret;
            WHSWorkLine whsWorkLine;

            ret = super();

            btnInboundShipConfirm.enabled(WHSPostPackingSlip::isShipConfirmEnabled(whsLoadTable));
            btnProductReceipt.enabled(WHSPostPackingSlip::isPackingSlipEnabled(whsLoadTable));
            btnOutboundShipConfirm.enabled(WHSShipConfirmationAction::newFromBuffer(whsLoadTable).canEnableShipConfirm());
            WHSSalesPackingSlipPost.enabled(WHSShipConfirm::isPackingSlipEnabledForBuffer(whsLoadTable));
            btnSendASN.enabled(WHSShipConfirm::isSendASNEnabledForLoad(whsLoadTable));
            btnBillOfLading.enabled(WHSShipConfirm::isBOLEnabledForLoad(whsLoadTable));
            btnReverseShipConfirm.enabled(WHSReverseShipConfirm::canShipConfirmationBeReversed(whsLoadTable));
            btnCancelPackingSlips.enabled(WHSReverseShipConfirm::canCancelSalesPackingSlip(whsLoadTable));
            btnPostShipTransfer.enabled(WHSShipConfirm::canShipTransferOrder(whsLoadTable));
            btnCancelProductReceipt.enabled(WHSReverseShipConfirm::canCancelProductReceipt(whsLoadTable));
            WHSWaveLabel.enabled(WHSWaveLabel::existLoadId(WHSLoadTable.LoadId));
            btnInboundReceivingCompleted.enabled(WHSLoadTable.canCompleteReceiving());
            btnInboundReverseReceivingCompleted.enabled(WHSLoadTable.canReverseReceivingCompleted());

            boolean transportLoadShipped = whsLoadTable.isAnyRelatedTransportLoadShipped();
            boolean packingSlipUpdated = whsLoadTable.isAnyRelatedPackingSlipUpdated();

            change.enabled(whsLoadTable.LoadStatus != WHSLoadStatus::Shipped && !transportLoadShipped);
            skipWorkLine.enabled(whsLoadTable.LoadStatus < WHSLoadStatus::Loaded && whsLoadTable.LoadStatus >= WHSLoadStatus::Posted);
            whsReverseWork.enabled(whsLoadTable.LoadStatus >= WHSLoadStatus::Posted 
                                && whsLoadTable.LoadStatus != WHSLoadStatus::Shipped
                                && !transportLoadShipped
                                && !packingSlipUpdated);

            select firstonly RecId from whsWorkLine
                where whsWorkLine.LoadId == whsLoadTable.LoadId;
            whsPickListShipping.enabled(whsWorkLine.RecId );

            this.enableTMSActions(whsLoadTable.canUseTMSActions());

            whsLoadTable_ds.allowEdit(whsLoadTable.LoadStatus < WHSLoadStatus::Shipped);
            whsLoadTable_ds.allowDelete(whsLoadTable.LoadStatus < WHSLoadStatus::Shipped);

			//Do not allow reverse work for loads containing a catch weight item.
            whsReverseWork.enabled(whsReverseWork.enabled() && !whsLoadTable.containsCatchWeightItem());

            return ret;
        }

public void init()
{
    super();

    qbds = this.query().dataSourceTable(tableNum(WHSLoadTable));
    qbrLoad = qbds.addRange(fieldNum(WHSLoadTable, LoadStatus));

    if (!filteredByMenuItem)
    {
        qbrLoad.value(whsLoadPlanningListPageForm.calcShowClosedRangeValue(showClosedLoads));
    }
    else 
    {
        if (element.args().parmEnumType() == enumNum(WHSLoadStatus))
        {
            qbrLoad.value(queryValue(enum2int(loadStatusFilter)));
        }

        if (activeOnly)
        {
            qbrLoad.value(queryRange(enum2int(WHSLoadStatus::Posted), enum2int(WHSLoadStatus::Loaded)));
        }
    }

    this.cacheAddMethod(tableMethodStr(WHSLoadTable, displayNumberOfShipments));
    this.cacheAddMethod(tableMethodStr(WHSLoadTable, displayNumberOfContainers));
    this.cacheAddMethod(tableMethodStr(WHSLoadTable, displayTotalVolume));
    this.cacheAddMethod(tableMethodStr(WHSLoadTable, displayTotalValue));
    this.cacheAddMethod(tableMethodStr(WHSLoadTable, tmsDisplayEquipmentCode));
    this.cacheAddMethod(tableMethodStr(WHSLoadTable, displayShipment));
    this.cacheAddMethod(tableMethodStr(WHSLoadTable, displayWave));
    this.cacheAddMethod(tableMethodStr(WHSLoadTable, displayTotalGrossWeight));
    this.cacheAddMethod(tableMethodStr(WHSLoadTable, displayTotalVolumeInLoad));
}

public void clicked()
{
    Args args = new Args();
    args.caller(this);
    args.parmObject(WHSLoadTable_DS);

    new MenuFunction(menuItemActionStr(WHSBillOfLadingGenerate), MenuItemType::Action).run(args);
}

public void clicked()
{
    whsLoadPlanningListPageForm.btnCancelPackingSlips_clicked(whsLoadTable);

    WHSLoadTable_ds.reread();
    WHSLoadTable_ds.refresh();
    // Refresh the menu items.
    btnReverseShipConfirm.enabled(WHSReverseShipConfirm::canShipConfirmationBeReversed(whsLoadTable));
    btnCancelPackingSlips.enabled(WHSReverseShipConfirm::canCancelSalesPackingSlip(whsLoadTable));
}

public boolean modified()
{
    boolean ret;

    ret = super();

    if (ret)
    {
        showClosedLoads = showClosed.checked();

        whsLoadTable_ds.executeQuery();

        element.formCustomFilterChanged();
    }
    return ret;
}
